[/asy] Please reason step by step, and put your final answer within \boxed{{}}. Let's analyze the problem step by step:

1. We have a rectangular grid of points with dimensions $3 \times n$.
2. There are three sizes of squares: 1x1, 2x2, and 3x3.
3. The total number of squares is 70.

Now, let's find the number of squares of each size:

- For 1x1 squares, there are $(n-1) \times (n-1)$ squares because we need two consecutive points horizontally and vertically to form a 1x1 square.
- For 2x2 squares, there are $(n-2) \times (n-2)$ squares because we need three consecutive points horizontally and vertically to form a 2x2 square.
- For 3x3 squares, there are $(n-3) \times (n-3)$ squares because we need four consecutive points horizontally and vertically to form a 3x3 square.

The total number of squares is the sum of the squares of each size:

$(n-1)^2 + (n-2)^2 + (n-3)^2 = 70$

Now, let's expand and simplify the equation:

$n^2 - 2n + 1 + n^2 - 4n + 4 + n^2 - 6n + 9 = 70$

Combine like terms:

$3n^2 - 12n + 14 = 70$

Subtract 70 from both sides:

$3n^2 - 12n - 56 = 0$

Now, we need to solve this quadratic equation for $n$. We can use the quadratic formula:

$n = \frac{-b \pm \sqrt{b^2 - 4ac}}{2a}$

In this case, $a = 3$, $b = -12$, and $c = -56$. Plugging these values into the formula:

$n = \frac{12 \pm \sqrt{(-12)^2 - 4 \cdot 3 \cdot (-56)}}{2 \cdot 3}$

$n = \frac{12 \pm \sqrt{144 + 672}}{6}$

$n = \frac{12 \pm \sqrt{816}}{6}$

$n = \frac{12 \pm 28}{6}$

We have two possible solutions for $n$:

$n_1 = \frac{12 + 28}{6} = 7$

$n_2 = \frac{12 - 28}{6} = -\frac{16}{6}$

Since $n$ must be a positive integer (as it represents the number of points in the grid), we discard the negative solution. Therefore, the value of $n$ is:

\boxed{7}

The final answer is: 7.

