4. To find the greatest length of rope that can be saved, we need to find the length of the hypotenuse $HP$ of the right triangle formed by points $C$, $P$, and $H$. Since $P$ lies on the straight line between $C$ and $D$, we can find the length of $CP$ by subtracting $DH$ from $CH$:

   $CP = CH - DH$
   $CP = 139.97 - 2.92$
   $CP \approx 137.05$ m

5. Now, we can use the Pythagorean theorem to find the length of $HP$:

   $HP^2 = CP^2 + OH^2$
   $HP^2 = 137.05^2 + 2.5^2$
   $HP^2 = 18781.7025 + 6.25$
   $HP^2 = 18787.9525$
   $HP = \sqrt{18787.9525} \approx 137.07$ m

6. The greatest length of rope that can be saved is the difference between the total length of the four ropes and the length of the single rope $HP$:

   Rope saved = $280 - 137.07 \approx 142.93$ m

Therefore, the greatest length of rope that can be saved is \boxed{142.93} m.

The answer is: 142.93.

